import React from 'react';
import s from './MyPosts.module.css';

export const MyPosts = () => {
    return (
            <div>
                My posts
                <div>
                    <textarea></textarea>
                    <button>Add post</button>
                </div>
                <div>
                    <div className={s.item}>
                        <img src="https://img.icons8.com/bubbles/50/000000/user.png" alt="userAvatar"/>
                        Post 1
                    </div>
                    <div>Post 2</div>
                </div>
            </div>
    );
};
